    public partial class frmChiTietHopDong : Page
    {
        private Model.APIEntity.DataLogin_Employee data;
        private string IdHopDong = "";
        private frmThanhMenuDoc frmMain;
        private PageDSHopDongNhanVien frmDSHD;
        private string LinkFile = "";
        private string TenFile = "";
        public frmChiTietHopDong(string IdHD, Model.APIEntity.DataLogin_Employee dt, frmThanhMenuDoc frm, string link, string ten, PageDSHopDongNhanVien frm1)
        {
            InitializeComponent();
            frmDSHD = frm1;
            frmMain = frm;
            data = dt;
            IdHopDong = IdHD;
            LinkFile = link;
            TenFile = ten;
            LoadDuLieuHDTrongChinhSua(IdHD);
        }
        List<BitmapImage> lstBI = new List<BitmapImage>();
        public List<clsTruongThayDoi.Data> lstTruongThayDoi = new List<clsTruongThayDoi.Data>();
        private string PathFile = "";
        private string IdFile = "";
        private void LoadDuLieuHDTrongChinhSua(string Id)
        {
            lstBI = new List<BitmapImage>();
            using (RestClient restclient = new RestClient(new Uri("https://crm.timviec365.vn/ApiWinform/detailContract")))
            {
                RestRequest request = new RestRequest();
                request.Method = Method.Post;
                request.AlwaysMultipartFormData = true;
                request.AddHeader("Authorization", data.token);
                request.AddParameter("id_contract", Id);
                RestResponse resAlbum = restclient.Execute(request);
                var b = resAlbum.Content;
                clsChiTietHopDong.Root receivedInfo = JsonConvert.DeserializeObject<clsChiTietHopDong.Root>(b);
                if (receivedInfo.data != null)
                {
                    PathFile = receivedInfo.data.path;
                    //IdFile = receivedInfo.data.id_file;
                    //PathFile = receivedInfo.data.path;
                    foreach (string b64 in receivedInfo.data.img_org_base64)
                    {
                        string[] ChiTiet = b64.Split(new[] { "data:image/png;base64," }, StringSplitOptions.None);
                        string Base64 = ChiTiet[ChiTiet.Length - 1];
                        byte[] binaryData = Convert.FromBase64String(Base64);
                        BitmapImage bi = new BitmapImage();
                        bi.BeginInit();
                        bi.StreamSource = new MemoryStream(binaryData);
                        bi.EndInit();
                        lstBI.Add(bi);
                    }
                    lsvImageHD.ItemsSource = lstBI;
                    clsTruongThayDoi.Data truong = new clsTruongThayDoi.Data();
                    foreach (clsChiTietHopDong.DetailFormContract detail in receivedInfo.data.detail_form_contract)
                    {
                        truong = new clsTruongThayDoi.Data();
                        for (int i = 0; i <= lstTruongThayDoi.Count; i++)
                        {
                            truong.IdTruong = i.ToString();
                            truong.TenTruong = detail.new_field;
                            truong.TuTK = detail.old_field;
                            truong.ViTriThayDoi = detail.index_field;
                            truong.TruongMacDinh = detail.default_field;
                        }
                        lstTruongThayDoi.Add(truong);
                        //lstTruongThayDoi = lstTruongThayDoi.ToList();

                        IdFile = detail.id_file;
                        PathFile = detail.path_file;


                    }


                    lsvTruongThayDoi.ItemsSource = lstTruongThayDoi;
                    //byte[] binaryData = Convert.FromBase64String("data:image/png;base64,");
                    //data:image/png;base64,
                }
            }
        }

        private void lsvImageHD_PreviewMouseWheel(object sender, MouseWheelEventArgs e)
        {
            scrollImageHD.ScrollToVerticalOffset(scrollImageHD.VerticalOffset - e.Delta);
        }

        private void btnChinhSua_MouseLeftButtonUp(object sender, MouseButtonEventArgs e)
        {
            ThemMoiHopDongNhanVien frm = new ThemMoiHopDongNhanVien(IdHopDong, frmMain, data, LinkFile, TenFile);
            pnlHienThi.Children.Clear();
            object content = frm.Content;
            frm.Content = null;
            //frm.Close();
            pnlHienThi.Children.Add(content as UIElement);
        }

        private void btnXoaHD_MouseLeftButtonUp(object sender, MouseButtonEventArgs e)
        {
            frmMain.pnlShowPopup.Children.Add(new Views.HopDong.Popup.dialogXoaHopDongNhanVien(IdHopDong, data, frmDSHD));
        }
    }
